import ListGroup from 'react-bootstrap/ListGroup'

export default function Result(props) {

    const {item}=props;
    //let show=item.map(item=>item);
    console.log(item)
    const itemShow = item.map((item, key) =>
    <li key={key}>{item}</li>
);
    return (
        <div>
            <ListGroup>
              {itemShow}
            </ListGroup>
        </div>
    )
}
